import React from "react";
import "../../components/homeContent/becomeInstructor2.css";

function BecomeInstructor2() {
  return (
    <div className="becomeInstructorDiv">
      <div className="backgroundColorDiv"></div>
      <img
        src="https://img.freepik.com/free-photo/portrait-corporate-woman-working-with-laptop-smiling-looking-assertive-white-background_1258-88546.jpg?w=900&t=st=1694780292~exp=1694780892~hmac=e3e1830dac6e5d6c7ef5b7e56d95d1fd2aef7f47042faee3f1e1586805193f1f"
        alt="instructorImg"
        className="instructorImg"
      ></img>
      <div className="contentDiv">
        <h2 className="heading">About us</h2>
        <p className="about">
         Valmiki is a curated platform where students can find courses on almost any topic. It has an embedded coding platform for hands-on practice. Best part-It's totally free{" "}
        </p>
   
      </div>
    </div>
  );
}

export default BecomeInstructor2;
